import "./SearchButtonStyle.css";
import { movieGenres } from "./MovieGenres.js";
import axios from "axios";
import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import FirstContainerMovies from './FirstContainerMovies';
import * as MovieSearchEngine from './MovieSearchEngine.js';

function SearchButton() {
  return (
    <button
      id="buttonstyle"
      type="button"
      onClick={() => MovieSearchEngine.GetMovieType(document.getElementById("inputstyle").value)}
    >
      Click Me!
    </button>
  );
}

export default SearchButton;
